import React from 'react'
import HTML from '../assets/html.png';
import CSS from '../assets/css.png';
import JavaScript from '../assets/javascript.png';
import ReactImg from '../assets/react.png';
import GitHub from '../assets/github.png';
import Tailwind from '../assets/tailwind.png';
import Flutter from "../assets/flutter.png";
import Figma from "../assets/figma.png";


const Skills = () => {
  return (
    <div name='skills' className="bg-[#1e2528] text-white">

        {/* <div className='pl-20'> */}
        <div  className='max-w-[1000px] mx-auto p-4 flex flex-col justify-center w-full h-full'>
            <div className=''>
                <p className='font-bold inline border-b-4 border-[#0EF6BE] max-sm:text-5xl text-7xl'>Skills</p>
                <p className='max-sm:text-4xl text-6xl sm:py-10 py-8'>These are the skills I am currently specializing.</p>
            </div>

            <div className='w-full grid grid-cols-2 sm:grid-cols-4 gap-4 text-center py-8'>
                <div className='sm:shadow-lg sm:shadow-black hover:scale-110 duration-300'>
                    <img className='w-20 max-sm:w-14 mx-auto' src={HTML} alt="HTML img" />
                    <p className='text-4xl my-4'>HTML</p>
                </div>
            </div>
        </div>

    </div>
     
  )
}

export default Skills
